import { useState, useEffect } from "react";
import { Container, Row, Col, Form } from "react-bootstrap";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { giftCardInf } from "../redux/actions/index.js";
import { useSelector, useDispatch } from "react-redux";
const GiftCard = () => {
  const [formData, updateFormData] = useState("");
  const [sendDate, setSendDate] = useState(new Date());
  const dispatch = useDispatch();
  const [amount, setAmount] = useState(undefined);
  const [name, setName] = useState("");
  const [surname, setSurname] = useState("");
  const [message, setMessage] = useState("");
  const isLoading = useSelector((state) => state.giftData.isLoading);
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState(undefined);
  const [date, setDate] = useState("");
  const handleAmount = (e) => {
    setAmount(e.target.value);
    dispatch(giftCardInf(formData));
  };
  const handleName = (e) => {
    setName(e.target.value);
    dispatch(giftCardInf(formData));
  };
  const handleSurname = (e) => {
    setSurname(e.target.value);
    dispatch(giftCardInf(formData));
  };
  const handleMessage = (e) => {
    setMessage(e.target.value);
    dispatch(giftCardInf(formData));
  };
  const handleEmail = (e) => {
    setEmail(e.target.value);
    dispatch(giftCardInf(formData));
  };
  const handlePhone = (e) => {
    setPhone(e.target.value);
    dispatch(giftCardInf(formData));
  };
  const handleDate = (e) => {
    setDate(e.target.value);
    dispatch(giftCardInf(formData));
  };
  const handleChange = (e) => {
    updateFormData({
      ...formData,

      // Trimming any whitespace
      [e.target.name]: e.target.value.trim(),
    });
  };
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
    // ... submit to API
  };

  return (
    <Container fluid>
      <Row>
        <img src="" alt="" />
        <div>
          <h1>Impuls Gaming</h1>
          <span>www.impulsgaming.com</span>
        </div>
      </Row>
      <Container>
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col>
              <h2>Give a Gift</h2>
              <h6>Choose amount</h6>
              <hr />
              <Form.Group
                as={Row}
                className="mb-3"
                controlId="formHorizontalEmail"
              >
                <Form.Label column sm={2}>
                  Amount*
                </Form.Label>
                <Col sm={4}>
                  <Form.Control
                    type="number"
                    placeholder="10"
                    min={0}
                    required
                    onChange={handleChange}
                  />
                </Col>
              </Form.Group>
              <h6>Personalise</h6>
              <Form.Group>
                <Form.Label column sm={2}>
                  To*
                </Form.Label>

                <Row>
                  <Col>
                    <Form.Control
                      placeholder="First name"
                      required
                      onChange={handleChange}
                    />
                  </Col>
                  <Col>
                    <Form.Control
                      placeholder="Last name"
                      required
                      onChange={handleChange}
                    />
                  </Col>
                </Row>
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Message</Form.Label>
                <Form.Control as="textarea" rows={3} onChange={handleChange} />
              </Form.Group>
              <h6>Schedule Delivery</h6>

              <Form.Group>
                <Form.Label>Send To*</Form.Label>

                <Row>
                  <Col>
                    <Form.Group className="mb-3">
                      <Form.Label>Email </Form.Label>
                      <Form.Control
                        type="email"
                        placeholder="Recipient Email"
                        onChange={handleChange}
                      />
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group className="mb-3">
                      <Form.Label>WhatsApp Number</Form.Label>
                      <Form.Control
                        type="tel"
                        placeholder="Recipient WhatsApp Number"
                        required
                        onChange={handleChange}
                      />
                    </Form.Group>
                  </Col>
                </Row>
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Delivery Date *</Form.Label>
                <DatePicker
                  selected={sendDate}
                  onChange={(date) => setSendDate(date)}
                  showTimeSelect
                  dateFormat="Pp"
                />
              </Form.Group>
            </Col>
            <Col></Col>
          </Row>
          <button type="submit">CheckOut</button>
        </Form>
      </Container>
    </Container>
  );
};
export default GiftCard;
